#include <stdio.h>

int main() {

    int a, b;
    scanf("%d%d", &a, &b);
    
    if(a == b) {
        printf("EDNAKVI\n");
    }
    
    if(a != b) {
        printf("RAZLICNI\n");
    }
    return 0;
}

#include <stdio.h>

int main() {

    int a, b;
    scanf("%d%d", &a, &b);
    
    if(a < b) {
        printf("PRVIOT E POMAL OD VTORIOT\n");
    }
    return 0;
}

В C языке символ амперсанда (&) используется для получения адреса переменной, так как функция scanf ожидает указатели (адреса переменных), куда нужно записать считанные данные.

Первый случай:
int n = 0;
scanf("%d", &n);  // &n — передаём адрес переменной n

Здесь n — обычная переменная типа int, поэтому чтобы scanf мог записать в неё значение, нужно передать её адрес с помощью &.

Второй случай:
int input(int* a, int* n) {
    // ...
    for (int* p = a; p - a < *n; p++) {
        if (scanf("%d", p) != 1) {  // p — уже указатель, & не нужен
            return 0;
        }
    }
    // ...
}
Здесь p — это указатель (тип int*), который изначально указывает на начало массива a и перемещается по нему (p++).
Поскольку p уже хранит адрес ячейки массива, передавать &p не нужно — это привело бы к передаче адреса самого указателя, а не элемента массива.

Почему во втором случае p не требует &?
p объявлен как int* p = a, то есть это указатель на int.

При итерации p++ он перемещается на следующий элемент массива.



!!!!!!!!!!scanf("%d", p) записывает значение прямо в ту ячейку памяти, на которую указывает p.



Если бы мы написали scanf("%d", &p), то:

&p — это адрес самого указателя (тип int**), а не элемента массива.

Это привело бы к неопределённому поведению, так как scanf попытался бы записать int по адресу указателя, а не в сам массив.

Вывод:
Если переменная обычная (не указатель) → нужен & для передачи адреса.

Если переменная уже является указателем → & не нужен, так как она и так хранит адрес.

#include <stdio.h>

int main() {

    int a, b, c;
    scanf("%d%d%d", &a, &b, &c);
    
    int zbir = a + c;
    int proizvod = b * c;
    
    printf("Zbirot e %d\n", zbir);
    printf("Proizvodot e %d\n", proizvod);
    return 0;
}

#include <stdio.h>

int main() {

    int x, y;
    scanf("%d%d", &x, &y);
    
    int zbir = x + y;
    printf("%d\n", zbir);
    
    return 0;
}

#include <stdio.h>

int main() {

    int x;
    scanf("%d", &x);
    
    printf("%d\n", x);
    
    
    return 0;
}

import java.util.*;

interface PaymentMethod {
    void processPayment(double amount);
}

class WalletPayment implements PaymentMethod {
    public void processPayment(double amount) {
        System.out.println("Rs. " + amount + " paid via Wallet.");
    }
}

class CardPayment implements PaymentMethod {
    public void processPayment(double amount) {
        System.out.println("Rs. " + amount + "paid via Card.");
    }
}

class CashPayment implements PaymentMethod {
    public void processPayment(double amount) {
        System.out.println("Rs. " + amount + " paid via Cash-on-Delivery.");
    }
}

abstract class User {
    protected String name;
    protected String email;
    protected String password;

    public User(String name, String email, String password) {
        this.name = name;
        this.email = email;
        this.password = password;
    }
    public String getName() {
        return name;
    }
    public String getEmail() {
        return email;
    }
}

class Customer extends User {
    public Customer(String name, String email, String password) {
        super(name, email, password);
    }

    public void placeOrder() {
        System.out.println(name + " placed an order.");
    }
}

class DeliveryAgent extends User {
    private static int count = 0;
    private Vehicle vehicle;

    public DeliveryAgent(String name, String email, String password, Vehicle vehicle) {
        super(name, email, password);
        this.vehicle = vehicle;
        count++;
    }

    public static int agentCount() {
        return count;
    }

    public Vehicle getVehicle() {
        return vehicle;
    }
}

abstract class Vehicle {
    protected String type;

    public String getType() {
        return type;
    }
}

class Scooter extends Vehicle {
    public Scooter() {
        this.type = "Scooter";
    }
}

class Bicycle extends Vehicle {
    public Bicycle() {
        this.type = "Bicycle";
    }
}

class FoodItem {
    private String itemName;
    private double price;
    private String category;

    public FoodItem(String itemName, double price, String category) {
        this.itemName = itemName;
        this.price = price;
        this.category = category;
    }

    public String getItemName() {
        return itemName;
    }
    public double getPrice() {
        return price;
    }
    public String getCategory() {
        return category;
    }
}

class Order {
    private List<FoodItem> foodItems;
    private Customer customer;
    private DeliveryAgent deliveryAgent;
    private Date orderTime;
    private double totalAmount;
    private String deliveryAddress;

    public Order(List<FoodItem> foodItems, Customer customer, DeliveryAgent deliveryAgent, String deliveryAddress) {
        this.foodItems = foodItems;
        this.customer = customer;
        this.deliveryAgent = deliveryAgent;
        this.deliveryAddress = deliveryAddress;
        this.orderTime = new Date();
        calculatePrice();
    }

    public void calculatePrice() {
        totalAmount = 0;
        for (FoodItem item : foodItems) {
            totalAmount += item.getPrice();
        }
    }

    public double getTotalAmount() {
        return totalAmount;
    }

    public void printSummary() {
        System.out.println("Customer: " + customer.getName());
        System.out.println("Delivery Rider: " + deliveryAgent.getName() + " (" + deliveryAgent.getVehicle().getType() + ")");
        System.out.println("Address: " + deliveryAddress);
        System.out.println("Time: " + orderTime);
        System.out.println("\n");
        for (FoodItem item : foodItems) {
            System.out.println("- " + item.getItemName() + " (" + item.getCategory() + ") Rs. " + item.getPrice());
        }
        System.out.println("Total Amount: Rs. " + totalAmount);
    }
}

interface OrderService {
    void placeOrder();
    void cancelOrder();
    void completeOrder();
}

class OrderManager implements OrderService {
    private List<Order> orderList = new ArrayList<>();

    public void addOrder(Order order) {
        orderList.add(order);
        placeOrder();
    }

    public void placeOrder() {
        System.out.println("Order placed.");
    }

    public void cancelOrder() {
        System.out.println("Order cancelled.");
    }

    public void completeOrder() {
        System.out.println("Order delivered.");
    }
}

public class FoodDeliverySystem {
    public static void main(String[] args) {

        Customer customer = new Customer("LightYagami", "NewWorld@hotmail.com", "Note666");
        DeliveryAgent agent = new DeliveryAgent("Saim", "saimfahad@gmail.com", "Zodd", new Scooter());

        List<FoodItem> items = new ArrayList<>();
        items.add(new FoodItem("Cheese Burger", 350, "Fast-Food"));
        items.add(new FoodItem("Mayo Fries", 150, "Side"));

        Order order = new Order(items, customer, agent, "Street 69-C, Hyderabad");
        order.printSummary();

        PaymentMethod payment = new CardPayment();
        payment.processPayment(order.getTotalAmount());

        OrderManager manager = new OrderManager();
        manager.addOrder(order);
        manager.completeOrder();
    }
}

add_action(
